import { Navbar, Group, Code, Button } from "@mantine/core";
import { IconLogout } from "@tabler/icons-react";
import { Link } from "react-router-dom";

const AccountNavbar = ({ labels, active }) => {
  return (
    <Navbar height={700} width={{ sm: 300 }} p="md">
      <Navbar.Section>
        {labels.map((item) => {
          return (
            <Button
              key={item.label}
              leftIcon={item.icon}
              variant={item.label === active ? "filled" : "subtle"}
              fullWidth
            >
              {item.label}
            </Button>
          );
        })}
      </Navbar.Section>
      <Divider />
      <Navbar.Section>
        <Button
          variant="subtle"
          leftIcon={<IconLogout stroke={1.5} />}
          fullWidth
        >
          Logout
        </Button>
      </Navbar.Section>
    </Navbar>
  );
};

export default AccountNavbar;
